import React from 'react';

export default function CheckBox({tableDisplay,productsX,nameCheckBox,onChangeCheckBox}) {
    return (
    <div className={tableDisplay ? "productTableDisplay" : "productTableDisplayNone" }>
        <h6>Choose the preferred {nameCheckBox.toLowerCase}</h6>
        {productsX
                .map((itemContext,index) => <div key={index}><input type="checkbox" name={nameCheckBox} value={itemContext} onChange={() => onChangeCheckBox(index)} /><label>{itemContext}</label></div>)
        }
    </div>
    )
}
